import React from 'react';
import logo from './logo.svg';
import './App.css';
import TotalsContainer from './totals-container';
import AveragesContainer from './averages-container';
import TabSwitchContainer from './tab-switch-container';

const App = (props) => {
  const [state, setState] = React.useState({
    tab: 0,
  });

  const handleTabChange = React.useCallback((newValue) => {
    this.setState({
      tab: newValue
    });
  });

  return (
    <div className="App">
      <header className="App-header">
        <TabSwitchContainer onChange={handleTabChange}>
          <TotalsContainer />
          <AveragesContainer />
          {this.state.tab}
        </TabSwitchContainer>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
